import {
  useParams
} from "react-router-dom";



function Page() {


	const [pages, setPages] = useState([]);
	const { fromNotifications } = this.props.location.state

	useEffect(() => {
		fetch(`https://dev.justinblayney.com/wp-json/wp/v2/pages/{this.props.location.state}`)
		.then(res => res.json())

		.then(json =>
			 setPages(json)
			  )

		.then(json => console.log(json))
		 });


	return (
	<>	
		{Object.keys(pages).map((ky, idx) => (

			<div id={this.props.location.state} key={idx}>
				<h1>{pages.title.rendered}</h1>
				<div dangerouslySetInnerHTML={ {__html: pages.content.rendered} } />
				{}
			</div>

		))}

	</>

	);
}

